create sequence seq_sum_protocol
    as integer
    minvalue 100;

alter sequence seq_sum_protocol owner to gesco;

create table if not exists dbo.protocol_results
(
    id                                bigint default nextval('dbo.seq_sum_protocol'::regclass) not null
        constraint sum_protocol_pk
            primary key,
    autonomous_community_country_code varchar(5),
    product_service_code              varchar(50),
    campaign_id                       bigint
        constraint sum_protocol_campaign_id_fk
            references dbo.campaign,
    protocol_code                     varchar(20),
    product_service_id                bigint
        constraint sum_protocol_product_service_id_fk
            references dbo.product_service,
    protocol_id                       bigint
        constraint sum_protocol_protocol_campaign_id_fk
            references dbo.protocol_campaign,
    created_at                        timestamp,
    updated_at                        timestamp,
    created_by                        bigint,
    updated_by                        timestamp,
    id_state                          integer,
    autonomous_community_country_id   bigint
        constraint sum_protocol_autonomous_community_country_id_fk
            references dbo.autonomous_community_country,
    code                              varchar(20)
);

alter table sum_protocol
    owner to gesco;

